INSERT INTO `cfg_skill` VALUES ('12347', '引导箭', '对生命值最少的敌人射出一发强力箭矢，造成大量伤害。\r\n提升 arg1 点伤害。', '1767.80', '717.20', null, null, null, null, '50.00', '17.50', '12411');
INSERT INTO `cfg_skill` VALUES ('12348', '魔爆术', '对敌方随机多个目标造成大量伤害。\r\n提升 arg1 点伤害。', '1500.50', '623.70', null, null, '2.00', '50.00', '50.00', '17.50', '12413');
INSERT INTO `cfg_skill` VALUES ('12349', '蓄力弹射', '向当前目标甩出巨大的回旋镖，并向最近的目标弹射多次。\r\n提升 arg1 点伤害。', '889.60', '409.80', null, null, '2.00', null, '50.00', '17.50', '12414');
INSERT INTO `cfg_skill` VALUES ('12350', '迅猛Pia击', '对当前目标进行疯狂爪击，造成可观的多段伤害。\r\n提升 arg1 点伤害。', '2177.60', '860.60', null, null, '4.00', null, '50.00', '17.50', '12420');
INSERT INTO `cfg_skill` VALUES ('12351', '搞怪炸弹', '投出的萝卜会在敌方中央炸开，造成伤害的同时形成粘液大幅减缓敌方的速度，持续数秒。\r\n提升 arg1 点伤害。\r\n迟缓效果对 arg2 级以下目标必定生效。', '713.50', '478.10', '1.00', '1.00', '60.00', '8.00', '50.00', '17.50', '12427');
INSERT INTO `cfg_skill` VALUES ('12352', '深呼吸', '持续一段时间喷出猛烈的火焰对当前目标造成伤害。\r\n提升 arg1 点伤害。', '1750.60', '683.00', null, null, '4.00', null, '50.00', '17.50', '12421');
INSERT INTO `cfg_skill` VALUES ('12353', '战斗咆哮', '剧烈的战吼震击所有敌人，造成伤害，并击飞目标。\r\n提升 arg1 点伤害。', '461.00', '286.90', null, null, '5.00', null, '50.00', '17.50', '12423');
INSERT INTO `cfg_skill` VALUES ('12354', '雪球风暴', '一定时间内砸落大量雪球，对随机多个目标造成多段伤害，并使之冻结。\r\n提升 arg1 点伤害。\r\n冻结效果对 arg2 级以下目标必定生效。', '495.10', '298.90', '1.00', '1.00', '6.00', '1.00', '50.00', '17.50', '12425');
INSERT INTO `cfg_skill` VALUES ('12355', '战争领袖', '使我方所有单位获得护盾，吸收一切伤害。\r\n伤害吸收量 arg1 点。', '447.10', '156.50', null, null, null, null, '50.00', '17.50', '12418');
INSERT INTO `cfg_skill` VALUES ('12356', '阻击小队', '使我方所有单位获得光环效果，ATK提升，直到自己倒下。\r\n提升 arg1 点ATK。', '99.40', '34.70', null, null, null, null, '50.00', '17.50', '12407');
INSERT INTO `cfg_skill` VALUES ('12357', '魔法之心', '使我方所有单位获得光环效果，MATK提升，直到自己倒下。\r\n提升 arg1 点MATK。', '79.50', '27.80', null, null, null, null, '50.00', '17.50', '12408');
INSERT INTO `cfg_skill` VALUES ('12358', '魔力流失', '偶尔会丢出带附魔效果的回旋镖，对当前目标造成伤害，并使其能量流失。\r\n提升 arg1 点伤害。', '266.40', '179.30', null, null, '3.00', '100.00', '50.00', '17.50', '12414');
INSERT INTO `cfg_skill` VALUES ('12359', '狂暴', '随着自身HP降低而提升ATK。\r\n提升 arg1 点ATK。', '4.10', '1.50', null, null, '1.00', null, '50.00', '17.50', '12417');
INSERT INTO `cfg_skill` VALUES ('12360', '重力投掷', '偶尔会用力抛出巨大的萝卜，对当前目标造成较大的伤害，并使当前目标短暂昏迷。\r\n提升 arg1 点伤害。\r\n昏迷效果对 arg2 级以下目标必定生效。', '5.30', '1.90', '1.00', '1.00', '3.00', '1.50', '50.00', '17.50', '12412');
INSERT INTO `cfg_skill` VALUES ('12361', '烈焰喷吐', '偶尔喷出大型火球，对当前目标会造成持续的燃烧效果。\r\n提升 arg1 点伤害。', '614.70', '215.20', null, null, '3.00', '2.00', '50.00', '17.50', '12422');
INSERT INTO `cfg_skill` VALUES ('12362', '金刚之躯', '坚实的躯体可大幅降低外来的伤害。\r\n减少 arg1 点伤害。', '186.30', '65.20', null, null, null, null, '50.00', '17.50', '12424');
INSERT INTO `cfg_skill` VALUES ('12363', '冰封爆破', '死亡时，向所有敌人吹出刺骨的冰风暴，造成可观的伤害。\r\n提升 arg1 点伤害。', '491.80', '172.10', null, null, null, null, '50.00', '17.50', '12426');
INSERT INTO `cfg_skill` VALUES ('12364', '两连弹', '向当前目标发射强力的两连弹，造成大量伤害，每下命中击退目标。\r\n提升 arg1 点伤害。', '953.00', '448.20', null, null, '3.00', '2.00', '50.00', '17.50', '12433');
INSERT INTO `cfg_skill` VALUES ('12365', '盲眼乱射', '偶尔向敌方随机多个目标发出散弹射击。\r\n提升 arg1 点伤害。', '263.50', '92.20', null, null, '3.00', '5.00', '50.00', '17.50', '12428');
INSERT INTO `cfg_skill` VALUES ('12366', '根须缠绕', '召唤出大量根须缠绕住所有敌方单位一段时间，使之无法移动并造成持续伤害。\r\n每秒造成 arg1 点伤害。\r\n技能对 arg2 级以下目标必定生效。', '234.60', '159.40', '1.00', '1.00', '3.00', null, '50.00', '17.50', '12429');
INSERT INTO `cfg_skill` VALUES ('12367', '大地亲和', '偶尔会唤起大地的回音，对我方所有目标进行治疗。\r\n提升 arg1 点效果。', '282.40', '98.80', null, null, '3.00', null, '50.00', '17.50', '12430');
INSERT INTO `cfg_skill` VALUES ('12368', '砸地板掀地砖', '猛砸地板掀起一块巨石朝目标扔去，击退目标，并使之昏迷一段时间。\r\n提升 arg1 点伤害。\r\n昏迷对 arg2 级以下目标必定生效。', '1458.40', '717.20', '1.00', '1.00', '10.00', '2.00', '50.00', '17.50', '12431');
INSERT INTO `cfg_skill` VALUES ('12369', '符文护甲', '开启远古的咒语，强化我方所有单位的身躯。\r\n减少 arg1 点伤害。', '89.40', '31.30', null, null, null, null, '50.00', '17.50', '12432');
INSERT INTO `cfg_skill` VALUES ('12370', '瞬影暗杀术', '消失并瞬移到最薄弱的单位背后并其进行偷袭。\r\n提升 arg1 点伤害。', '1581.50', '652.00', null, null, null, null, '50.00', '17.50', '12435');
INSERT INTO `cfg_skill` VALUES ('12371', '撕裂', '偶尔会使目标创伤，造成一段时间的流血伤害。\r\n提升 arg1 点伤害。', '420.20', '147.10', null, null, '3.00', '4.00', '50.00', '17.50', '12436');
INSERT INTO `cfg_skill` VALUES ('12372', '风暴附体', '一段时间内提升所有角色的速度和伤害。\r\n增加 arg1 点伤害。', '1581.50', '652.00', null, null, '0.50', '8.00', '50.00', '17.50', '12435');
